?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">Армин Мантей знаменитый немецкий производитель часов, родившийся в 1961 году. С самого детства он мечтал создать оригинальные и эксклюзивные часы. И у него это превосходно получилось. Основные принципы A. MANTEI производство изысканных часов, сделанных вручную; использование высококачественных материалов и надежных механизмов; часы должны подчеркнуть индивидуальность и вкус владельца. Элегантный дизайн этих часов порадует любого человека. Часовые индексы и стрелки изготовлены из стали, золота или серебра, а циферблаты имеют ручную гравировку. Стоит отметить, что Армин Мантей производит не только мужские, но и женские наручные часы (между прочим, имеют корпус из желтого золота, 4 бриллианта на циферблате, вместе с сапфировым стеклом).&nbsp;</span></span></p>
 
